import { makeStyles } from '@material-ui/core/styles'

export default makeStyles({
  grid: {
    display: 'flex'
  },
  title: {
    padding: '0 16px'
  },
  form: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'center'
  },
  fileInput: {
    width: '97%',
    margin: '10px 0'
  },
  buttonSubmit: {
    marginBottom: 10,
    width: 'fit-content',
    backgroundColor: 'green',
    borderRadius: '15px',
    mariginTop:'8px',
    padding:'5px'
  }
})
